import React from "react";
import "./header.css";
import people from "../../assets/people.png";
import ai from "../../assets/ai.png";

const Header = () => {
  return (
    <div className="gpt3__header section__padding" id="home">
      <div className="gpt__header-content">
        <h1 className="gradient__text">
          Let's build something amazing with GPT3 OpenAI
        </h1>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Laboriosam,
          natus eligendi. Minus facere consequuntur perspiciatis labore ratione,
          ipsa perferendis dolores?
        </p>
        <div className="gpt3__header-content__input">
          <input type="email" placeholder="Enter your email" />
          <button>Get Started</button>
        </div>
        <div className="gpt3__header-content__people">
          <img src={people} alt="Some People here" />
          <p>1064 people requested access a visit in last 24 hours</p>
        </div>

        <div className="gpt3__header-image">
        <img src={a} alt="" />
        </div>
      </div>
    </div>
  );
};

export default Header;
